export const playerRanks = [
  // Beginner Ranks (Levels 1-10)
  { level: 1, name: 'PIXEL NOVICE', minXP: 0, color: '#9CA3AF', icon: '🌱' },
  { level: 2, name: 'DATA SEEKER', minXP: 100, color: '#9CA3AF', icon: '🔍' },
  { level: 3, name: 'LOG KEEPER', minXP: 250, color: '#9CA3AF', icon: '📝' },
  { level: 4, name: 'BYTE WARRIOR', minXP: 450, color: '#9CA3AF', icon: '⚔️' },
  { level: 5, name: 'CODE SCOUT', minXP: 700, color: '#9CA3AF', icon: '🎯' },

  // Intermediate Ranks (Levels 6-15)
  { level: 6, name: 'DIGITAL RANGER', minXP: 1000, color: '#10B981', icon: '🏹' },
  { level: 7, name: 'CYBER GUARDIAN', minXP: 1350, color: '#10B981', icon: '🛡️' },
  { level: 8, name: 'MATRIX EXPLORER', minXP: 1750, color: '#10B981', icon: '🗺️' },
  { level: 9, name: 'PIXEL KNIGHT', minXP: 2200, color: '#10B981', icon: '🗡️' },
  { level: 10, name: 'DATA CHAMPION', minXP: 2700, color: '#10B981', icon: '🏆' },

  // Advanced Ranks (Levels 11-25)
  { level: 11, name: 'BYTE COMMANDER', minXP: 3250, color: '#3B82F6', icon: '⭐' },
  { level: 12, name: 'LOGIC OVERLORD', minXP: 3850, color: '#3B82F6', icon: '🔮' },
  { level: 13, name: 'SYSTEM ARCHITECT', minXP: 4500, color: '#3B82F6', icon: '🏗️' },
  { level: 14, name: 'NEURAL HACKER', minXP: 5200, color: '#3B82F6', icon: '🧠' },
  { level: 15, name: 'QUANTUM ANALYST', minXP: 5950, color: '#3B82F6', icon: '⚛️' },

  // Expert Ranks (Levels 16-30)
  { level: 16, name: 'CYBER SAGE', minXP: 6750, color: '#8B5CF6', icon: '🔯' },
  { level: 17, name: 'MATRIX MASTER', minXP: 7600, color: '#8B5CF6', icon: '👑' },
  { level: 18, name: 'DIGITAL EMPEROR', minXP: 8500, color: '#8B5CF6', icon: '🏛️' },
  { level: 19, name: 'DATA DEITY', minXP: 9450, color: '#8B5CF6', icon: '⚡' },
  { level: 20, name: 'PIXEL LEGEND', minXP: 10450, color: '#8B5CF6', icon: '🌟' },

  // Legendary Ranks (Levels 21-50)
  { level: 21, name: 'BINARY TITAN', minXP: 11500, color: '#F59E0B', icon: '🏔️' },
  { level: 25, name: 'ALGORITHM OVERLORD', minXP: 15000, color: '#F59E0B', icon: '👁️' },
  { level: 30, name: 'SYSTEM OMEGA', minXP: 22500, color: '#F59E0B', icon: '🔱' },
  { level: 35, name: 'QUANTUM SUPREME', minXP: 35000, color: '#DC2626', icon: '💎' },
  { level: 40, name: 'DIGITAL TRANSCENDENT', minXP: 55000, color: '#DC2626', icon: '🌌' },
  { level: 50, name: 'PIXEL OMNARCH', minXP: 100000, color: '#DC2626', icon: '♦️' }
];

export const getRankByXP = (totalXP) => {
  return [...playerRanks].reverse().find(rank => totalXP >= rank.minXP) || playerRanks[0];
};

export const getNextRank = (currentLevel) => {
  return playerRanks.find(rank => rank.level > currentLevel);
};
